import React, { useState } from "react";
import "./Homepage.css";

export default function HomePage() {
  const [fileUploaded, setFileUploaded] = useState(false);
  const [folderUploaded, setFolderUploaded] = useState(false);
  const [folderContents, setFolderContents] = useState([]);
  const [selectedFiles, setSelectedFiles] = useState([]);
  const [uploadStatus, setUploadStatus] = useState({
    uploaded: false,
    analyzed: false,
    message: "",
    analysisResults: [],
  });
  const [isUploading, setIsUploading] = useState(false);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [fileProgress, setFileProgress] = useState({});
  const [analysisData, setAnalysisData] = useState([]);

  const CHUNK_SIZE = 1024 * 1024 * 500; // 500MB

  const handleFileUpload = (event) => {
    const files = event.target.files;
    if (files.length > 0) {
      setSelectedFiles(Array.from(files));
      setFileUploaded(true);
      setFolderUploaded(false);
    }
  };

  const handleUploadToBackend = async () => {
    if (selectedFiles.length === 0) {
      alert("Tidak ada file yang dipilih.");
      return;
    }
    setIsUploading(true);
    const sessionId = Date.now().toString();

    try {
      for (const file of selectedFiles) {
        let formData = new FormData();
        formData.append("file", file);

        await fetch("http://localhost:5000/upload", {
          method: "POST",
          body: formData,
        });
      }

      setUploadStatus({ uploaded: true, analyzed: false });
      setIsUploading(false);
      setIsAnalyzing(true);
      analyzeFiles();
    } catch (error) {
      console.error("Upload error:", error);
      setIsUploading(false);
    }
  };

  const analyzeFiles = async () => {
    try {
      const response = await fetch("http://localhost:5000/analyze", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ files: selectedFiles.map(file => file.name) })
      });

      const result = await response.json();
      setAnalysisData(result.analysis);
      setUploadStatus({ uploaded: true, analyzed: true });
      setIsAnalyzing(false);
    } catch (error) {
      console.error("Analysis error:", error);
    }
  };

  return (
    <div className="container-homepage">
      <nav className="navbar">HauntAI</nav>
      <div className="upload-container">
        <h2>Upload File or Folder</h2>
        <p className="upload-limit">Maksimum ukuran file: 1GB</p>
        <div className="upload-options">
          <div className="upload-box">
            <label className={`upload-label ${folderUploaded ? "disabled" : ""}`}>
              Upload File
              <input type="file" multiple onChange={handleFileUpload} disabled={folderUploaded} />
            </label>
          </div>
        </div>
        <button className="upload-button" onClick={handleUploadToBackend} disabled={isUploading || isAnalyzing}>
          {isUploading ? "Uploading..." : isAnalyzing ? "Analyzing..." : "Upload"}
        </button>
      </div>

      {selectedFiles.length > 0 && (
        <div className="folder-content-container">
          <h3>File yang Akan Diupload:</h3>
          <ul>
            {selectedFiles.map((file, index) => (
              <li key={index}>{file.name}</li>
            ))}
          </ul>
        </div>
      )}

      {uploadStatus.analyzed && (
        <div className="analysis-container">
          <h3>Hasil Analisis</h3>
          <ul>
            {analysisData.map((file, index) => (
              <li key={index}>
                <strong>{file.filename}</strong>: {file.reason}
                <button onClick={() => window.open(file.download_url)} style={{ marginLeft: "10px" }}>
                  Download Hasil Analisis
                </button>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}
